import './App.css';
import Customer from './components/Customer';
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/Table/TableBody';
import TableRow from '@material-ui/core/Table/TableRow';
import TableCell from '@material-ui/core/Table/TableCell';

const customers = [
{
  'id':1,
  'img' : 'https://placeimg.com/64/64/1',
  'name' : '김태희',
  'birthday' : '931018',
  'gender' : '남자',
  'job' : '개발'

},
{
  'id':2,
  'img' : 'https://placeimg.com/64/64/2',
  'name' : '홍길동',
  'birthday' : '950318',
  'gender' : '남자',
  'job' : '대학생'

}, 
{
  'id':3,
  'img' : 'https://placeimg.com/64/64/3',
  'name' : '장다혜',
  'birthday' : '910907',
  'gender' : '여자',
  'job' : '디자이너'

}
]

function App() {
  return (
    <div>
        <Table>
          <TableBody>


          {customers.map(c => { return ( <Customer key={c.id} id={c.id} img={c.img} name={c.name} gender={c.gender} birthday={c.birthday} job={c.job} />) })}
          </TableBody>
        </Table>

    </div>

  );
}

export default App;
